DUPLEX PROUDLY PRESENTS:

Rune Factory Oceans PS3-DUPLEX

What secrets lie in this vast new land? And who is the sinister masked stranger who threatens to destroy it? With the aid of the giant golem Ymir and a colourful cast of characters, Aden and Sonja will cross vast oceans, discover dungeons packed with riches, fertile islands ripe for planting, and battle fearsome monsters! At the end of their journey lies the key to undoing their curse and saving their newfound home. The brash Aden and cheerful Sonja are two friends enjoying life in their peaceful island town until theyre struck by a mysterious curse: they awaken to find that theyve been transported to a strange new island, and that both of their souls are now trapped in the same body 

Platform: PS3
Firmware: FW 4.11 required!
Language: English
Genre: Action
